import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Menu from './components/menu/Menu'; // Importa o Menu
import Home from './pages/Home'; // Importa a página Home
import Catalogo from './pages/Catalogo'; // Importa a página Catálogo
import PosGraduacao from './pages/PosGraduacao'; // Importa a página Pós-Graduação
import Eventos from './pages/Eventos'; // Importa a página Eventos
import Validadores from './pages/Validadores'; // Importa a página Validadores
import Layouts from './pages/Layouts'; // Importa a página Layouts
import Ajuda from './pages/Ajuda'; // Importa a página Ajuda

function App() {
  return (
    <Router>
      <Menu /> {/* Adiciona o Menu em todas as páginas */}
      <Switch>
        <Route exact path="/" component={Home} />
        <Route path="/catalogo" component={Catalogo} />
        <Route path="/pos-graduacao" component={PosGraduacao} />
        <Route path="/eventos" component={Eventos} />
        <Route path="/validadores" component={Validadores} />
        <Route path="/layouts" component={Layouts} />
        <Route path="/ajuda" component={Ajuda} />
      </Switch>
    </Router>
  );
}

export default App;
